import {Link} from "react-router-dom";

let Header = () => {
    return(
        <header>
            <a href={'/'}>호텔 로고</a>
            <ul>
                <li><Link to={'/'}>호텔</Link></li>
                <li><Link to={'/login'}>로그인</Link></li>
                <li><Link to={'/plus'}>더보기</Link></li>
            </ul>
        </header>
    )
}

export default Header
